INSERT INTO `news_list` (`id`, `title`, `post_date`, `image`, `content`, `updated_on`) VALUES
(20, 'Phát hiện lái tàu thủy vi phạm nồng độ cồn trên sông Lô', '2023-04-17 11:33:38', 'uploads/new_img/1681705980_phathienlo.jpg', '<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\">Khoảng 14h15, CSGT kiểm tra tàu có trọng tải toàn phần hơn 700 tấn do lái tàu N.H.L. (sinh năm 1985, ở Bạch Hạc, Việt Trì, Phú Thọ) cầm lái. Ông L. đồng thời là thuyền trưởng của con tàu này.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\">Kết quả đo nồng độ cồn của lái tàu là 0,056 mg/l khí thở. Vi phạm ở mức 1 quy định tại Nghị định 139/2021/NĐ-CP. Ngoài ra, phương tiện cũng được xác định có vạch dấu mớn nước an toàn không đảm bảo quy định.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\"><img src=\"data:image/png;base64,', '2023-04-17 04:36:46');
INSERT INTO `news_list` (`id`, `title`, `post_date`, `image`, `content`, `updated_on`) VALUES
(21, 'CSGT Hà Nội phạt hàng trăm người điều khiển xe máy chạy ngược chiều', '2023-04-17 11:38:31', 'uploads/new_img/1681706280_csgthn.jpg', '<p><span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 13px;\">Phần mở rộng trên đường Nguyễn Xiển, thành phố Hà Nội do Ban Quản lý dự án đầu tư xây dựng công trình hạ tầng kỹ thuật và nông nghiệp Hà Nội làm chủ đầu tư. Việc mở rộng nhằm giải quyết tình trạng ùn tắc khi một phần lòng đường bị rào chắn để thi công Dự án nhà máy xử lý nước thải Yên Xá.</span></p><p><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 660px;\"><span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 13px;\"><br></span></p>', NULL);
INSERT INTO `news_list` (`id`, `title`, `post_date`, `image`, `content`, `updated_on`) VALUES
(22, 'Tuyên truyền phổ biến giáo dục pháp luật về an toàn giao thông tại Ban Quản lý các Khu công nghiệp Bắc Ninh', '2023-04-17 11:39:23', 'uploads/new_img/1681706340_tuyentruyen.jpg', '<p><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 660px;\"></p><p><span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 13px;\">Tại Hội nghị, báo cáo viên của Phòng CSGT đã truyền đạt những nội dung cơ bản của Nghị quyết, Kế hoạch xây dựng Tỉnh ATGT, nhiệm vụ, giải pháp đảm bảo ATGT gắn với địa bàn các KCN: Tình hình giao thông có liên quan, tai nạn giao thông, vi phạm giao thông, tình trạng công nhân vi phạm Luật giao thông; Hướng dẫn kỹ năng tham gia giao thông an toàn, phòng tránh tai nạn.</span><br></p>', NULL);
INSERT INTO `news_list` (`id`, `title`, `post_date`, `image`, `content`, `updated_on`) VALUES
(23, 'Vi phạm quá tải vì nghĩ “trời mưa CSGT không làm việc”', '2023-04-17 11:39:55', 'uploads/new_img/1681706340_viphamquatai.jpg', '<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\">Ngày 13/02, ghi nhận tại tuyến quốc lộ 2, thuộc xã Lưỡng Vượng, TP. Tuyên Quang lực lượng CSGT thuộc Phòng CSGT Công an tỉnh Tuyên Quang đang thực hiện nhiệm vụ kiểm soát các phương tiện vận tải hàng hóa nhằm phát hiện xử lý các trường hợp vi phạm chở quá tải trọng, cơi nới thành thùng xe, lúc này thời tiết khá xấu, trời mưa nặng hạt và có sương mù…</p><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma; text-align: center;\"><figure class=\"image\" style=\"display: inline-block;\"><img alt=\"\" height=\"440\" src=\"https://www.csgt.vn/lib/ckfinder/images/Nam%202023/Thang%204/14/TQ/DSC_4024.JPG\" width=\"660\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: 0px 0px; max-width: 760px;\"><figcaption><em style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: 0px 0px;\">CSGT kiểm tra tải trọng các phương tiện khi lưu thông qua QL 2.</em></figcaption></figure></div>', NULL),
(24, 'Những chuyển biến tích cực sau thời gian tăng cường kiểm tra xử lý vi phạm nồng độ cồn ở Đắk Nông', '2023-04-17 11:40:22', 'uploads/new_img/1681706460_nhungchuyenbien.jpg', '<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\">Ngay sau khi được triệt triển khai thực hiện nghiêm túc Điện chỉ đạo của đồng chí Bộ trưởng Bộ Công an về các giải pháp bảo đảm trật tự an toàn giao thông, lực lượng CSGT toàn tỉnh đã phối hợp với lực lượng cảnh sát cơ động, công an xã lập 22 tổ công tác với 4.132 lượt cán bộ chiến sĩ tổ chức kiểm tra nồng độ cồn và ma túy đối với người điều khiển phương tiện giao thông kể cả ngày lẫn đêm vào các khung giờ cao điểm buổi trưa và buổi tối, nguời tham gia giao thông bằng xe ô tô, xe máy cũng đã ý thức hơn trong việc sử dụng rượu bia khi lái xe.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma; text-align: center;\"><img alt=\"\" height=\"390\" src=\"https://www.csgt.vn/lib/ckfinder/images/Nam%202023/Thang%204/15/%C4%90ak%20Nong/IMG_20230321_193610.jpg\" width=\"660\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: 0px 0px; max-width: 760px;\"></p>', '2023-04-17 04:41:12'),
(25, 'Cảnh sát đường thủy Bắc Ninh xử lý thuyền viên trên phương tiện thủy vi phạm nồng độ cồn', '2023-04-17 11:40:54', 'uploads/new_img/1681706400_csduongthuy.jpg', '<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\">Theo đó, lúc 14h50, ngày 12/4, tổ công tác thực hiện chuyên đề nồng độ cồn thuộc Đội cảnh sát đường thủy, Phòng Cảnh sát giao thông Công an tỉnh Bắc Ninh tuần tra kiểm soát trên tuyến sông Cầu, tiến hành kiểm tra đo nồng độ cồn đối với người điều khiển, người làm việc trên tàu thủy mang biển số NĐ-382x, trọng tải 864 tấn, đi từ Nam Định đến Bắc Giang, qua kiểm tra phát hiện máy trưởng Ninh Văn xxx, sinh năm 1970, ở Cát Thành, Trực Ninh, Nam Định vi phạm nồng độ cồn ở mức 0,246 miligam/1 lít khí thở.</p><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma; text-align: center;\"><figure class=\"image\" style=\"display: inline-block;\"><img alt=\"\" height=\"560\" src=\"https://www.csgt.vn/lib/ckfinder/images/Nam%202023/Thang%204/14/BN/z4264570503316_c4b9d92f75ce635b30c18065103ef8aa.jpg\" width=\"660\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: 0px 0px; max-width: 760px;\"><figcaption>Cảnh sát đường thủy đo nồng độ cồn người điều khiển phương tiện đường thủy.</figcaption></figure></div><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\">Trên tuyến sông Đuống, ngày 13/4, Đội Cảnh sát đường thủy tiếp tục phát hiện thủy thủ Vũ Văn xxx, sinh năm 1966, ở Đạo Lý, Lý Nhân, Hà Nam là thuyền viên tàu Hna – 029x, trọng tải 1.117 tấn, vi phạm mức độ cồn 0,102 miligam/1 lít khí thở.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\">Tất cả hai trường hợp vi phạm trên đều đã bị lực lượng Cảnh sát đường thủy tiến hành lập biên bản xử lý nghiêm.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\">Đồng thời, từ đầu năm đến nay thực hiện cao điểm tuần tra kiểm soát xử lý vi phạm trên lĩnh vực giao thông đường thủy, lực lượng Cảnh sát đường thủy Bắc Ninh tăng cường công tác tuyên truyền thực hiện cuộc vận động “Vì bình yên sông nước”, tổ chức ký cam kết chấp hành Luật Giao thông đường thủy nội địa, kiểm tra phát hiện xử lý hơn 200 lượt phương tiện vi phạm chở quá vạch dấu mớn nước an toàn, vi phạm nồng độ cồn….và bàn giao Cơ quan Cảnh sát điều tra một vụ sử dụng giấy tờ, bằng cấp chuyên môn giả.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\">Để góp phần xây dựng Bắc Ninh trở thành “Tỉnh an toàn giao thông” và nhằm răn đe, giáo dục, tạo chuyển biến tích cực về nhận thức, ý thức chấp hành pháp luật của người dân khi tham gia giao thông trên lĩnh vực đường thủy nội địa, Trong thời gian tới lực lượng Cảnh sát đường thủy Bắc Ninh sẽ tiếp tục tăng cường tuần tra, kiểm soát, xử lý vi phạm theo chuyên đề “Người điều kiển phương tiện giao thông đường bộ, đường thủy nội địa mà trong cơ thể có chất ma túy, vi phạm nồng độ cồn”.</p>', NULL),
(26, 'Tuyên Quang: Hàng loạt “ma men” bị tuýt còi trong đêm', '2023-04-17 11:43:51', 'uploads/new_img/1681706580_hangloat.jpg', '<div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma; text-align: center;\"><figure class=\"image\" style=\"display: inline-block;\"><img alt=\"\" height=\"439\" src=\"https://www.csgt.vn/lib/ckfinder/images/Nam%202023/Thang%204/13/TQ/z4260436254771_c1a1ef9e81684f733d9b78b6e80e40ca.jpg\" width=\"660\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: 0px 0px; max-width: 760px;\"><figcaption><em style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: 0px 0px;\">Lực lượng CSGT thuộc Phòng CSGT Công an tỉnh Tuyên Quang kiểm soát vi phạm nồng độ cồn trên QL37.</em></figcaption></figure></div><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\">Đúng 19h, tổ công tác của Phòng CSGT, Công an tỉnh Tuyên Quang đã có mặt đầy đủ để triển khai các phương án tuần tra, kiểm soát, xử lý các trường hợp người tham gia giao thông vi phạm nồng độ cồn.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: tahoma;\">Ngoài các chốt kiểm soát đã được phân công từ trước, CSGT còn triển khai phương án hóa trang kết hợp tuần tra lưu động để xử lý tài xế vi phạm. Cán bộ được giao nhiệm vụ hóa trang mặc thường phục sẽ được trang bị bộ đàm, camera để ghi lại toàn bộ quá trình vi phạm của tài xế đồng thời liên lạc với các tổ tuần tra.</p>', NULL);

